   "source": [
    "## **INTRODUCTION**\n",
    "\n",
    "This case study is part of Coursera's Google Data Analytics Professional Certificate Capstone. I was given 2 options to complete the case study: 1) select one of the datasets provided; or 2) search for a public dataset to develop a business case for an area of personal interest. I chose the first option and picked the Cyclistic Bike-Share dataset to work on.\n",
    "\n",
    "#### **Scenario:**\n",
    "I am part of the marketing analyst team of a fictional bike-share program in Chicago called Cyclistic. Cyclistic offers flexible pricing plans for its users: single-ride passes, full-day passes, and annual memberships. Customers availing single-ride or full-day passes are referred to as casual riders. Meanwhile, those who purchase annual memberships are Cyclistic members. Cyclistic's finance analysts team believes that annual memberships are more profitable than casual rider passes. Lily Moreno, director of marketing and my manager, believes that increasing the number of annual members will be key to the company's growth. Hence, she set a goal to design marketing strategies aimed at encouraging casual riders to avail of annual memberships.\n"
   ]
  },
