   "source": [
    "## **ASK PHASE**\n",
    "\n",
    "#### **Business Task:** \n",
    "Analyze the difference in Cyclistic bike usage patterns between casual riders and annual members. Based on the insights derived from the analysis, provide top 3 recommendations on new marketing strategies aimed at converting casual riders into annual members.\n",
    "\n",
    "\n"
   ]
  },
