   "source": [
    "# Create a new column for ride_length\n",
    "bikeshare_data_cleaned <- bikedata_12month %>%\n",
    "  mutate(ride_length = as.numeric(ended_at - started_at), # in seconds\n",
    "         day_of_week = format(started_at, \"%A\"), # full day name format\n",
    "         month = format(started_at, \"%B\"), # full month name format\n",
    "         hour = hour(started_at))"
   ]
