   "source": [
    "8. I used ***summary()*** to check the minimum and maximum values in the *ride_length*, and confirmed 2 issues that may affect the accuracy of the data and skew my analysis. I resolved this by using the parameters defined by the data source on what constitutes a standard bike trip.\n",
    "\n",
    "    a. **Negative values** - Apart from the negative values in *ride_length*, I also removed the trips with less than 60 seconds duration. According to the [data source](https://divvybikes-marketing-staging.lyft.net/system-data), the raw data was supposed to exclude ride lengths below 60 seconds, as they are \"potentially false starts or users trying to re-dock a bike to ensure it was secure.\"\n",
    "\n",
    "    b. **Extremely long ride lengths** - The maximum value was 93,596 seconds, which is roughly 26 hours. These high values are possibly due to a technical glitch or user error. I have decided to remove all trips that are more than 3 hours long. I have come to this decision based on Cyclistic's [rates](https://divvybikes.com/pricing) for each ride options. The longest a rider can use a bicycle (Day Pass option) before they start incurring additional charges per minute is 3 hours. This suggests that rides exceeding 3 hours are no longer standard trips based on this parameter, but rather extended rentals, likely with different user behavior and motivations. With the removal of trips that are more than 3 hours, I can focus on the data that represents the most common use case."
   ]
  },
