   "source": [
    "# Calculate average ride length by member type\n",
    "average_ride_length <- bikeshare_data_cleaned %>%\n",
    "  group_by(member_casual) %>%\n",
    "  summarize(avg_ride_length_mins = round(mean(ride_length) / 60))\n",
    "\n",
    "# Create bar plot\n",
    "ggplot(average_ride_length, aes(x = member_casual, y = avg_ride_length_mins, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  geom_text(aes(label = paste(avg_ride_length_mins, \"minutes\")), vjust = -0.3, size = 4) +\n",
    "  labs(\n",
    "    title = \"Average Ride Length by Rider Type\",\n",
    "    x = \"Rider Type (Member/Casual)\",\n",
    "    y = \"Average Ride Length (minutes)\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(plot.title = element_text(hjust = 0.5, face = \"bold\", size = 18)) +\n",
    "  theme(axis.title.x = element_text(size = 10)) +\n",
    "  theme(axis.title.y = element_text(size = 10))"
   ]
