   "source": [
    "# Calculate average ride length by day of week and member type\n",
    "avg_ride_length_by_day <- bikeshare_data_cleaned %>%\n",
    "  group_by(day_of_week, member_casual) %>%\n",
    "  summarize(avg_ride_length_mins = round(mean(ride_length) / 60))\n",
    "\n",
    "# Create a bar chart\n",
    "ggplot(avg_ride_length_by_day, aes(x = day_of_week, y = avg_ride_length_mins, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  facet_wrap(~member_casual, ncol = 2) +\n",
    "  labs(\n",
    "    title = \"Average Ride Length by Day of Week\",\n",
    "    x = \"Day of Week\",\n",
    "    y = \"Average Ride Length (minutes)\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(strip.text.x = element_text(size = 12),\n",
    "        plot.title = element_text(hjust = 0.5, face = \"bold\"),\n",
    "        axis.text.x = element_text(angle = 45, hjust = 1)) +\n",
    "  scale_x_discrete(limits = c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\"))"
   ]
