   "source": [
    "# Average ridership by day of the week and member type\n",
    "daily_usage <- bikeshare_data_cleaned %>%\n",
    "  group_by(member_casual, day_of_week, date = as.Date(started_at)) %>%\n",
    "  summarise(daily_rides = n()) %>%\n",
    "  group_by(member_casual, day_of_week) %>%\n",
    "  summarise(avg_rides = mean(daily_rides))\n",
    "\n",
    "# Create bar chart\n",
    "ggplot(daily_usage, aes(x = day_of_week, y = avg_rides, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  facet_wrap(~member_casual, ncol = 2) +\n",
    "  labs(\n",
    "    title = \"Average Ridership by Day of Week\", \n",
    "    x = \"Day of the Week\",\n",
    "    y = \"Average Number of Rides\"  \n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(strip.text.x = element_text(size = 12),\n",
    "        plot.title = element_text(hjust = 0.5, face = \"bold\"),\n",
    "        axis.text.x = element_text(angle = 45, hjust = 1)) +\n",
    "  scale_x_discrete(limits = c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")) +\n",
    "  scale_y_continuous(labels = scales::comma)"
   ]
  },
