    "\n",
    "# Convert hour to numeric for plotting\n",
    "hourly_usage$hour <- as.numeric(hourly_usage$hour)\n",
    "\n",
    "# Create a line plot\n",
    "ggplot(hourly_usage, aes(x = hour, y = ride_count, color = member_casual)) +\n",
    "  geom_line() +\n",
    "  labs(\n",
    "    title = \"Hourly Distribution of Riders Per Member Type\",\n",
    "    x = \"Hour of Day\",\n",
    "    y = \"Number of Rides\",\n",
    "    color = \"Member Type\"\n",
    "  ) +\n",
    "  scale_x_continuous(breaks = seq(0, 23, by = 1)) +  # Ensure all hours are shown\n",
    "  theme_minimal() +\n",
    "  theme(plot.title = element_text(hjust = 0.5, face = \"bold\")) +\n",
    "  scale_y_continuous(labels = scales::comma)"
   ]
