   "source": [
    "# Calculate number of riders by month and member type\n",
    "rider_counts_by_month <- bikeshare_data_cleaned %>%\n",
    "  group_by(member_casual, month) %>%\n",
    "  summarise(rider_count = n())\n",
    "\n",
    "# Order the months for proper plotting\n",
    "month_order <- c(\"January\", \"February\", \"March\", \"April\", \"May\", \"June\", \"July\", \"August\", \"September\", \"October\", \"November\", \"December\")\n",
    "rider_counts_by_month$month <- factor(rider_counts_by_month$month, levels = month_order)\n",
    "\n",
    "# Create the bar chart\n",
    "ggplot(rider_counts_by_month, aes(x = month, y = rider_count, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Number of Riders by Month and Member Type\",\n",
    "    x = \"Month\",\n",
    "    y = \"Number of Riders\",\n",
    "    fill = \"Member Type\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1)) +\n",
    "  theme(plot.title = element_text(hjust = 0.5, face = \"bold\")) +\n",
    "  scale_y_continuous(labels = scales::comma)"
   ]
