    "# Calculate average ride length per month and member type\n",
    "avg_ride_length_by_month <- bikeshare_data_cleaned %>%\n",
    "  group_by(member_casual, month) %>%\n",
    "  summarise(avg_ride_length = mean(ride_length) / 60)\n",
    "\n",
    "# Order the months for proper plotting\n",
    "month_order <- c(\"January\", \"February\", \"March\", \"April\", \"May\", \"June\", \"July\", \"August\", \"September\", \"October\", \"November\", \"December\")\n",
    "avg_ride_length_by_month$month <- factor(avg_ride_length_by_month$month, levels = month_order)\n",
    "\n",
    "\n",
    "# Create the bar chart\n",
    "ggplot(avg_ride_length_by_month, aes(x = month, y = avg_ride_length, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Average Ride Length by Month and Member Type\",\n",
    "    x = \"Month\",\n",
    "    y = \"Average Ride Length\",\n",
    "    fill = \"Member Type\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1)) +\n",
    "  theme(plot.title = element_text(hjust = 0.5, face = \"bold\"))"
   ]
  },
